return new Promise(resolve => {
  this.appliedCode = discountCode;

  if (isSameText(discountCode, 'minimal50')) {
    if (this.cart.items_subtotal_price >= 5000) {
      resolve({
        enabled: true,
        code: this.appliedCode
      });
      this.calculateCart();
    } else {
      resolve({
        enabled: false,
        code: this.appliedCode,
        error: 'Server return error: min purhcase $50.00'
      });
      this.appliedCode = '';
    }
  } else if (isSameText(discountCode, 'valid')) {
    resolve({
      enabled: true,
      code: discountCode
    });
    this.calculateCart();
  } else {
    this.appliedCode = '';
    resolve({
      enabled: false,
      code: discountCode,
      error: 'Discount code not valid'
    });
  }
})

return new Promise(resolve => {
  const pillowCase = cart.items.find(item => item.id === 33007919595555);

  if (pillowCase) {
    resolve({
      valid: true,
      isAuto: true,
      code: 'testauto',
      discount: 500
    });
  } else if (isSameText(this.appliedCode, 'minimal50')) {
    if (cart.items_subtotal_price >= 5000) {
      resolve({
        valid: true,
        code: this.appliedCode,
        discount: 1000
      });
    } else {
      resolve({
        valid: false,
        code: this.appliedCode,
        reason: 'purchase',
        minPurchase: 5000
      });
      this.appliedCode = '';
    }
  } else if (isSameText(this.appliedCode, 'valid')) {
    resolve({
      valid: true,
      code: this.appliedCode,
      discount: 1500
    });
  } else {
    resolve({
      valid: false,
      code: ''
    });
    this.appliedCode = '';
  }
})
